            .then((response) => {
                setData(response.data)
            })
            .catch((err) => {
                console.log(err)
            })
    })

    const submit = () => {

    }
    
    return (  
        <>
            {data.map((tag) => 
            <>
                <ul key={tag.id}>
                    {/* <li>{tag.id} - {tag.name}</li> */}
                    <input type="checkbox" id={tag.id}/>
